import React from "react";
import "./team.css";
import img01 from "../../../assets/img/aboutus/team/ancil.png";
import img02 from "../../../assets/img/aboutus/team/sundas.png";
import img03 from "../../../assets/img/aboutus/team/borna.png";
import img04 from "../../../assets/img/aboutus/team/neethu.png";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Team = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 1000,
    slidesToShow: 4,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  const isMobile = window.innerWidth <= 450;

  return (
    <>
      {isMobile ? (
        <Slider {...settings}>
        <div className="team-grid">
          <div className="img000">
            <img src={img01} alt="Image 1" className="team-image" />
            <img src={img02} alt="Image 2" className="team-image" />
          </div>
  
          <div className="img000">
            <img src={img03} alt="Image 3" className="team-image" />
            <img src={img04} alt="Image 4" className="team-image" />
          </div>
     
          <div className="img000">
            <img src={img04} alt="Image 5" className="team-image" />
            <img src={img04} alt="Image 5" className="team-image" />
          </div>
        </div>
        </Slider>
      ) : (
        <Slider {...settings}>
          <div className="img000">
            <img src={img01} alt="Image 1" className="team-image" />
          </div>
          <div className="img000">
            <img src={img02} alt="Image 2" className="team-image" />
          </div>
          <div className="img000">
            <img src={img03} alt="Image 3" className="team-image" />
          </div>
          <div className="img000">
            <img src={img04} alt="Image 4" className="team-image" />
          </div>
          <div className="img000">
            <img src={img04} alt="Image 5" className="team-image" />
          </div>
        </Slider>
      )}
    </>
  );
};

export default Team;
